import React from "react";

const Navigation = ({ onRouteChange }) => {
	return (
		<nav style={{ display: "flex", justifyContent: "flex-end" }}>
			<p
				onClick={() => onRouteChange("SignIn")}
				className="fw6 f3 link dim white pa3 mr4 pointer"
			>
				Sign Out
			</p>
		</nav>
	);
};

export default Navigation;
